import {createGlobalStyle} from 'styled-components';

const GlobalStyle = createGlobalStyle`
@font-face {font-family: "iconfont";
  src: url('./iconfont.eot?t=1605382995268'); /* IE9 */
  src: url('./iconfont.eot?t=1605382995268#iefix') format('embedded-opentype'), /* IE6-IE8 */
  url('data:application/x-font-woff2;charset=utf-8;base64,') format('woff2'),
  url('./iconfont.woff?t=1605382995268') format('woff'),
  url('./iconfont.ttf?t=1605382995268') format('truetype'), /* chrome, firefox, opera, Safari, Android, iOS 4.2+ */
  url('./iconfont.svg?t=1605382995268#iconfont') format('svg'); /* iOS 4.1- */
}

.iconfont {
  font-family: "iconfont" !important;
  font-size: 16px;
  font-style: normal;
  -webkit-font-smoothing: antialiased;
  -moz-osx-font-smoothing: grayscale;
}

.iconfangdajing:before {
  content: "\e66b";
}

.icona:before {
  content: "\e602";
}

.iconqianbi:before {
  content: "\e63d";
}
`
